% --------------------------------------------------------------------------
function dydt = fun_eval(tau,kmrgd,par_k1,par_k2,par_k3,par_k4,par_t,par_gam)
c=par_gam*par_t^par_gam*sqrt(par_k1*par_k4/par_k2/par_k3)+par_gam*par_t^par_gam+2*par_t^2*(par_k3*par_k4/par_k1/par_k2)^(1/2/par_gam);
z=(c-par_gam*kmrgd(1)-par_gam*kmrgd(2))/2;
dydt=[par_k1*kmrgd(2)*z^par_gam-par_k3*kmrgd(1)*kmrgd(2)^2;
-par_k1*kmrgd(2)*z^par_gam+2*par_k2*kmrgd(1)*z^par_gam+par_k3*kmrgd(1)*kmrgd(2)^2-2*par_k4*kmrgd(2)^3;];

